import { NavLink } from 'react-router-dom'
import { BrowserRouter, Route, Routes } from 'react-router-dom';

const Navbar = () => {
  return (
    <div className="Navbar">
      <input type="checkbox" id="navcheck" role="button" title="menu" />
      <label htmlFor="navcheck" aria-hidden="true" title="menu">
        <span className="burger">
          <span className="bar">
            <span className="visuallyhidden">Menu</span>
          </span>
        </span>
      </label>
      <nav id="menu">
      <Routes>
              <Route path="/Componnent/Home" element={<Home />} />
              <Route path="/Componnent/SlideRecord" element={<SlideRecord />} />
              <Route path="/Componnent/SpeedSlalomRecord" element={<SpeedSlalomRecord />} />
            </Routes>
      </nav>
    </div>
  );
};

export default Navbar;
